import React, { Component } from 'react'

class Tags extends Component{
    createTags = () => {
      return this.props.list.map(tag =>
        <span className="tag">
            {tag}
        </span>)
    }
    render() {
        const width: React.CSSProperties = {
            height: "48px",
            minWidth: this.props.width
        }
        return (
            <div className="tag-list">
              {this.createTags()}
            </div>
        )
    }
}

export default Tags
